import React, { useState } from "react";
import './Movies.css';
import { Link } from "react-router-dom";
import DateTimePicker from "react-datetime-picker";

function Bookingpage(){
    const[value, setValue] = useState(new Date())

  return (
            <><div className="container">
          <DateTimePicker onChange={setValue} value={value}></DateTimePicker>
      </div>
      <div className="card">
              <ul className="list-group">
                  <li className="list-group-item ">Date</li>
                  <li className="list-group-item btn-primary">Available Show Timings</li>
                  <li className="list-group-item btn-primary"><Link to='/Seatbooking'>Choose Number of Seats</Link></li>
                  <li><Link to='/Bookingpage'>Book Now</Link></li>
              </ul>
          </div></>
    );
}

export default Bookingpage;
